import React from 'react'
import './Product.css';

const Product = ({ productItems }) => {
    return (
        <div className='products'>
            {productItems.map((productItems) => (
                <div className='card'>
                    <div>
                        <img
                            className='product-image'
                            src={productItems.image}
                            alt={productItems.name}
                        />
                    </div>
                </div>

            )

            )}

        </div>
    )
}

export default Product
